script: |
  super -f text -I q5765.spq | sort > q5765.out

inputs:
  - name: q5765.spq
    data: |
      SELECT - 90 * ( - - col1 ) + - col2 AS col2 FROM tab1 (FORMAT parquet) WHERE + col1 + - + col2 * - col0 * - col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q5765.out
    data: |
      -1356
      -4298
      -509
